import React from "react";
import { columns } from "./columns";
import Column from "../../components/table";

const TableOne = () => {
    return (
        <div>
            {
                columns.map((column, index) => {
                    return (
                        <Column column={column} key={index}/>
                    )
                })
            }
        </div>
    )
}

export default TableOne;
